import {objExtrato} from "../App"



function getByOperator() {
	fetch("http://localhost:8080/transaction/operator", 
        {

            method: "GET", 
            body: JSON.stringify(objExtrato),
            mode: 'cors',
            headers: {
                'Content-Type': 'application/json',
            }
        }
    ).then(response => response.json())
    .them(convertedResponse => setExtrato(convertedResponse))
}
